import React from 'react';

function CardTextarea(props) {
  return (
    <fieldset>
      <textarea 
        name={props.name} 
        id={props.id} 
        placeholder={props.placeholder} 
        required 
      ></textarea>
    </fieldset>
  );
}

export default CardTextarea;
